import React, { Component } from "react";
import TodoContainer from "./containerComponents/TodoContainer";
import SignUpView from "./textComponents/SignUpView";
import { BrowserRouter, Route } from "react-router-dom";

const style = {
  container: {
    height: "100vh",
    width: "100%",
    display: "flex",
    justifyContent: "center",
    alignItems: "center"
  }
};

export class Main extends Component {
  state = {
    loggedIn: false
  };

  loggedIn = () => {
    this.setState({
      loggedIn: this.loggedIn
    })
    console.log(this.state.loggedIn)
  }

  render() {
    return (
      <BrowserRouter>
        <div style={style.container}>
          <Route path="/" component={SignUpView} onClick={this.loggedIn} exact />
          <Route path="/home" component={TodoContainer} />
        </div>
      </BrowserRouter>
    );
  }
}

export default Main;
